INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0009', 'inspiration', 'Studded Velocity Collar', 'studded-velocity-collar', NULL, 'A bold women''s jewelry set defined by sculptural stud geometry, rhythmic repetition, and assertive metallic presence.', 'A high-impact, modern inspiration where precision-cut stud elements form a continuous collar and bracelet - balancing strength, sensuality, and controlled aggression with refined wearability.', '/images/inspirations/insp-0009.jpeg', NULL, '["set"]', 'female', '["Eclipse"]', '["Eclipse-like","Studded","Geometric","Architectural"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, NULL, NULL, NULL, NULL, '["metal:White Gold","stone:None"]', '["Repeating stud geometry creates a powerful visual cadence.","High-polish metal surfaces deliver impact without reliance on diamonds.","Articulated construction ensures comfort while preserving rigidity.","The set reads confident, modern, and unapologetically strong across necklace and bracelet."]', 'Translate stud proportions into Heerawalla''s proprietary geometry language.|Maintain articulation to avoid stiffness while preserving edge.|Control stud height to balance boldness with everyday wearability.|Ensure mirror-polish finishing for maximum light reflection and precision.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["bold","sculptural","rhythmic","assertive"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
