INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0005', 'inspiration', 'Axis Forge Bracelet', 'axis-forge-bracelet', NULL, 'A sculpted men''s bracelet defined by linear balance, restrained diamond accents, and engineered symmetry.', 'An Axis-led inspiration where structured geometry and controlled repetition express strength, precision, and modern masculinity - eschewing ornamentation in favor of intentional form and balance.', '/images/inspirations/insp-0005.png', NULL, '["bracelet"]', 'male', '["Axis"]', '["Axis-like","Linear","Structured"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, '0.5', NULL, '2.5|3', NULL, '["metal:Yellow Gold","stone:Lab Diamond"]', '["Linear segments establish visual strength and order.","Diamonds are used sparingly to emphasize structure rather than decoration.","Balanced proportions ensure a confident, masculine presence.","Bracelet design prioritizes wearability and durability for everyday use."]', 'Maintain strict symmetry and consistent spacing across segments.|Keep diamond scale subtle to preserve a masculine aesthetic.|Ensure clasp integration is seamless and structurally sound.|Design articulation to allow comfort without breaking linear continuity.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '0.5', 0, 0, '["axis","linear","balanced","masculine"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0004', 'inspiration', 'Spiral Reverie Set', 'spiral-reverie-set', NULL, 'A rose-gold spiral set defined by cascading coils and diamond-lined rhythm.', 'A Continuum-led inspiration where spiral geometry unfolds across necklace, earrings, and bracelet - creating a sense of motion, sensuality, and sculptural elegance without relying on rigid symmetry.', '/images/inspirations/insp-0004.png', NULL, '["set"]', 'female', '["Continuum"]', '["Continuum-like","Spiral","Flowing"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, NULL, NULL, NULL, NULL, '["metal:Rose Gold","stone:Lab Diamond"]', '["Spiral forms create fluid motion and visual softness.","Cascading elements establish rhythm and hierarchy across the set.","Diamonds accent form rather than dominate it.","Bracelet extends the spiral language into a wearable, everyday expression."]', 'Translate spiral geometry into proprietary Heerawalla proportions.|Control coil spacing to preserve lightness and avoid visual clutter.|Ensure articulation allows natural drape on neck and wrist.|Limit diamond density to maintain elegance and comfort.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["spiral","cascading","sensual"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0007', 'inspiration', 'Regal Filigree Cascade', 'regal-filigree-cascade', NULL, 'An opulent women''s jewelry set defined by intricate gold filigree, pear-drop motifs, and ceremonial brilliance.', 'A heritage-inspired composition where classical filigree craftsmanship meets refined diamond articulation - designed for grandeur, celebration, and unmistakable presence while retaining balance and grace.', '/images/inspirations/insp-0007.png', NULL, '["set"]', 'female', '["Continuum"]', '["Continuum-like","Filigree","Pear Drop","Ornamental"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, '1', NULL, '2.5|3', NULL, '["metal:18K Yellow Gold","stone:Lab Diamond"]', '["Filigree latticework creates richness without visual heaviness.","Pear-drop elements introduce movement and ceremonial elegance.","Diamond placement emphasizes pattern and flow rather than singular focal stones.","The set reads cohesive and regal across necklace and earrings."]', 'Translate ornamental filigree into Heerawalla''s refined proportions.|Maintain negative space within lattice to preserve lightness.|Control drop length and articulation for comfort and stability.|Ensure high-polish gold surfaces contrast cleanly with pave detailing.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["ornate","filigree","ceremonial","luxurious"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0002', 'inspiration', 'Luminous Orbit Set', 'luminous-orbit-set', NULL, 'A refined diamond set defined by circular motifs and fluid pave detailing.', 'An elegant inspiration set for clients drawn to timeless symmetry and graceful motion, where concentric forms and soft curves create a balanced, luminous presence across necklace, earrings, and ring.', '/images/inspirations/insp-0002.jpeg', NULL, '["set"]', 'unisex', '["Continuum"]', '["Continuum-like","Circular","Flowing"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, NULL, NULL, NULL, NULL, '["metal:18K Yellow Gold","stone:Lab Diamond"]', '["Circular motifs create harmony and visual continuity across the set.","Pave diamonds act as a continuous halo rather than focal points.","Balanced scale delivers elegance without excess."]', 'Translate concentric forms into Heerawalla''s proprietary proportions.|Maintain fluid articulation for comfort and drape.|Control pave density to preserve lightness and refined brilliance.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["luminous","circular","elegant"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0001', 'inspiration', 'Regal Orbit Cascade', 'regal-orbit-cascade', NULL, 'A refined station necklace with cushion halos and a pear-drop finale, paired with matching pear-drop earrings and a slim pave bangle.', 'This inspiration reads like modern heirloom: a disciplined line of halo-set stations linked by polished gold marquise connectors, culminating in a pear-drop pendant that adds soft movement without breaking symmetry. The matching earrings echo the drop silhouette for a cohesive, formal set, while the slim pave bangle keeps the look light and wearable - diamond-forward, elegant, and event-ready.', '/images/inspirations/insp-0001.jpeg', NULL, '["set"]', 'unisex', '["Modern"]', '["Continuum-like","Halo","Pear Drop","Station"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, NULL, NULL, NULL, NULL, '["metal:Yellow Gold","stone:Lab Diamond"]', '["Station halos create a rhythmic, high-brilliance neckline.","Pear-drop finale adds graceful movement and a focal finish.","Gold marquise connectors introduce negative space and articulation.","Matching earrings complete the vertical story without excess.","Slim pave bangle balances the set with everyday wearability."]', 'Keep halo thickness slim and consistent across all stations for a clean read.|Use micro-pave with tight, even beadwork; avoid bulky walls.|Ensure articulated connectors are comfort-safe (no pinch points) and sit flat on collarbone.|Design pendant drop to be removable or adjustable for versatility.|Offer 16-18in adjustable length with secure clasp and safety latch option.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["heirloom-modern","halo-stations","pear-drop","formal"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
INSERT INTO catalog_items (id, type, name, slug, description, short_desc, long_desc, hero_image, collection, categories, gender, styles, motifs, metals, metal_options, stone_types, stone_type_options, stone_weight, stone_weight_range, metal_weight, metal_weight_range, palette, takeaways, translation_notes, design_code, cut, cut_range, clarity, clarity_range, color, color_range, carat, is_active, is_featured, tags, created_at, updated_at, updated_by) VALUES ('insp-0010', 'inspiration', 'Convergence Axis Set', 'convergence-axis-set', NULL, 'A modern white-gold diamond set defined by fluid crossover geometry, featuring a slim bangle, sculpted pendant, refined drop earrings, and a crossover ring.', 'This inspiration expresses contemporary elegance through controlled motion: softly tapered white-gold forms converge at deliberate junctions, highlighted by restrained pave diamond accents. The bangle anchors the set with a graceful crossover focal point, while the pendant translates the same geometry into a vertical, elongated silhouette. Matching earrings mirror the converging lines for visual continuity, and the crossover ring completes the set with a refined, everyday-wearable statement - balanced, architectural, and unmistakably modern.', '/images/inspirations/insp-0010.png', NULL, '["set"]', 'female', '["Axis"]', '["Axis-like","Crossover","Convergence","Fluid Geometry"]', '["18k Yellow Gold","18K White Gold","14K Yellow Gold","14K WhiteGold"]', NULL, '["Natural Diamond","Lab Grown Diamond"]', NULL, NULL, NULL, NULL, NULL, '["metal:18K White Gold","stone:Lab Diamond"]', '["Crossover geometry creates visual tension resolved through balance.","Diamond placement is concentrated only at convergence points for a disciplined, architectural read.","Slim white-gold profiles maintain lightness and everyday wearability.","Each piece translates the same core form without repetition or heaviness.","The full set reads cohesive yet allows each piece to stand independently."]', 'Maintain soft tapering on all gold arms - avoid sharp or aggressive tips.|Keep pave limited to convergence zones to preserve negative space.|Ensure bangle and ring have comfort-safe inner contours for daily wear.|Match diamond size graduation consistently across all pieces.|Finish in high-polish white gold with clean, minimal prongs for a crisp modern look.', NULL, 'IDEAL|EXCELLENT', NULL, 'IF-VVS|VS|SI', NULL, 'E|F|G|H', NULL, '1', 0, 0, '["modern-elegance","crossover-flow","architectural","balanced"]', '2026-01-23 02:33:32', '2026-01-23 02:33:32', NULL);
